  reg  [31 : 0] G1_b;
  reg  [31 : 0] G1_c;
  reg  [31 : 0] G1_d;
  wire [31 : 0] G1_m0;
  wire [31 : 0] G1_m1;
  wire [31 : 0] G1_a_prim;
  wire [31 : 0] G1_b_prim;
  wire [31 : 0] G1_c_prim;
  wire [31 : 0] G1_d_prim;

  reg  [31 : 0] G2_a;
  reg  [31 : 0] G2_b;
  reg  [31 : 0] G2_c;
  reg  [31 : 0] G2_d;
  wire [31 : 0] G2_m0;
  wire [31 : 0] G2_m1;
  wire [31 : 0] G2_a_prim;
  wire [31 : 0] G2_b_prim;
  wire [31 : 0] G2_c_prim;
  wire [31 : 0] G2_d_prim;

  reg  [31 : 0] G3_a;
  reg  [31 : 0] G3_b;
  reg  [31 : 0] G3_c;
  reg  [31 : 0] G3_d;
  wire [31 : 0] G3_m0;
  wire [31 : 0] G3_m1;
  wire [31 : 0] G3_a_prim;
  wire [31 : 0] G3_b_prim;
  wire [31 : 0] G3_c_prim;
  wire [31 : 0] G3_d_prim;


  //----------------------------------------------------------------
  // Module instantations.
  //----------------------------------------------------------------
  blake2s_m_select mselect(
                           .clk(clk),
                           .reset_n(reset_n),
                           .load(load_m),
                           .m(block),
                           .round(round_ctr_reg),
                           .mode(G_mode),
                           .G0_m0(G0_m0),
                           .G0_m1(G0_m1),
                           .G1_m0(G1_m0),
                           .G1_m1(G1_m1),
                           .G2_m0(G2_m0),
                           .G2_m1(G2_m1),
                           .G3_m0(G3_m0),
                           .G3_m1(G3_m1)
                          );


  blake2s_G G0(
               .a(G0_a),
               .b(G0_b),
               .c(G0_c),
               .d(G0_d),
               .m0(G0_m0),
               .m1(G0_m1),
               .a_prim(G0_a_prim),
               .b_prim(G0_b_prim),
               .c_prim(G0_c_prim),
               .d_prim(G0_d_prim)
              );


  blake2s_G G1(
               .a(G1_a),
               .b(G1_b),
               .c(G1_c),
               .d(G1_d),
               .m0(G1_m0),
               .m1(G1_m1),
               .a_prim(G1_a_prim),
               .b_prim(G1_b_prim),
               .c_prim(G1_c_prim),
               .d_prim(G1_d_prim)
              );


  blake2s_G G2(
               .a(G2_a),
               .b(G2_b),
               .c(G2_c),
               .d(G2_d),
               .m0(G2_m0),
               .m1(G2_m1),

               .a_prim(G2_a_prim),
               .b_prim(G2_b_prim),
               .c_prim(G2_c_prim),
               .d_prim(G2_d_prim)
              );


  blake2s_G G3(
               .a(G3_a),
               .b(G3_b),
               .c(G3_c),
               .d(G3_d),
               .m0(G3_m0),
               .m1(G3_m1),
               .a_prim(G3_a_prim),
               .b_prim(G3_b_prim),
               .c_prim(G3_c_prim),
               .d_prim(G3_d_prim)
              );


  //----------------------------------------------------------------
  // Concurrent connectivity for ports etc.
  //----------------------------------------------------------------
  // Note little to big endian conversion.
  assign digest = {h_reg[0][7 : 0], h_reg[0][15 : 8], h_reg[0][23 : 16], h_reg[0][31 : 24],
                   h_reg[1][7 : 0], h_reg[1][15 : 8], h_reg[1][23 : 16], h_reg[1][31 : 24],
                   h_reg[2][7 : 0], h_reg[2][15 : 8], h_reg[2][23 : 16], h_reg[2][31 : 24],
                   h_reg[3][7 : 0], h_reg[3][15 : 8], h_reg[3][23 : 16], h_reg[3][31 : 24],
                   h_reg[4][7 : 0], h_reg[4][15 : 8], h_reg[4][23 : 16], h_reg[4][31 : 24],
                   h_reg[5][7 : 0], h_reg[5][15 : 8], h_reg[5][23 : 16], h_reg[5][31 : 24],
                   h_reg[6][7 : 0], h_reg[6][15 : 8], h_reg[6][23 : 16], h_reg[6][31 : 24],
                   h_reg[7][7 : 0], h_reg[7][15 : 8], h_reg[7][23 : 16], h_reg[7][31 : 24]};

  assign ready = ready_reg;


  //----------------------------------------------------------------
  // reg_update
  //
  // Update functionality for all registers in the core.
  // All registers are positive edge triggered with asynchronous
  // active low reset. All registers have write enable.
  //----------------------------------------------------------------
  always @ (posedge clk)
    begin : reg_update
      integer i;

      if (!reset_n) begin
        for (i = 0; i < 8; i = i + 1) begin
          h_reg[i] <= 32'h0;
        end

        for (i = 0; i < 16; i = i + 1) begin
          v_reg[i] <= 32'h0;
        end

        t0_reg           <= 32'h0;
        t1_reg           <= 32'h0;
        last_reg         <= 1'h0;
        ready_reg        <= 1'h1;
        round_ctr_reg    <= 4'h0;
        blake2s_ctrl_reg <= CTRL_IDLE;
      end
      else begin
        if (h_we) begin
          for (i = 0; i < 8; i = i + 1) begin
            h_reg[i] <= h_new[i];
          end
        end

        if (v_we) begin
          for (i = 0; i < 16; i = i + 1) begin
            v_reg[i] <= v_new[i];
          end
        end

        if (t0_we) begin
          t0_reg <= t0_new;
        end

        if (t1_we) begin
          t1_reg <= t1_new;
        end

        if (last_we) begin
          last_reg <= last_new;
        end

        if (ready_we) begin
          ready_reg <= ready_new;
        end

        if (round_ctr_we) begin
          round_ctr_reg <= round_ctr_new;
        end

        if (blake2s_ctrl_we) begin
          blake2s_ctrl_reg <= blake2s_ctrl_new;
        end
      end
    end // reg_update


  //----------------------------------------------------------------
  // state_logic
  //
  // Logic for updating the hash state.
  //----------------------------------------------------------------
  always @*
    begin : state_logic
      integer i;

      for (i = 0; i < 8; i = i + 1) begin
        h_new[i] = 32'h0;
      end
      h_we   = 1'h0;

      if (init_state) begin
        h_new[0] = IV0 ^ parameter_block[31  :   0];
        h_new[1] = IV1 ^ parameter_block[63  :  32];
        h_new[2] = IV2 ^ parameter_block[95  :  64];
        h_new[3] = IV3 ^ parameter_block[127 :  96];
        h_new[4] = IV4 ^ parameter_block[159 : 128];
        h_new[5] = IV5 ^ parameter_block[191 : 160];
        h_new[6] = IV6 ^ parameter_block[223 : 192];
        h_new[7] = IV7 ^ parameter_block[255 : 224];
        h_we     = 1;
      end

      if (update_state) begin
        h_new[0] = h_reg[0] ^ v_reg[0] ^ v_reg[8];
        h_new[1] = h_reg[1] ^ v_reg[1] ^ v_reg[9];
        h_new[2] = h_reg[2] ^ v_reg[2] ^ v_reg[10];
        h_new[3] = h_reg[3] ^ v_reg[3] ^ v_reg[11];
        h_new[4] = h_reg[4] ^ v_reg[4] ^ v_reg[12];
        h_new[5] = h_reg[5] ^ v_reg[5] ^ v_reg[13];
        h_new[6] = h_reg[6] ^ v_reg[6] ^ v_reg[14];
        h_new[7] = h_reg[7] ^ v_reg[7] ^ v_reg[15];
        h_we     = 1;
      end
    end // state_logic


  //----------------------------------------------------------------
  // compress_logic
  //----------------------------------------------------------------
  always @*
    begin : compress_logic
      integer i;

      for (i = 0; i < 16; i = i + 1) begin
        v_new[i] = 32'h0;
      end
      v_we = 1'h0;

      G0_a = 32'h0;
      G0_b = 32'h0;
      G0_c = 32'h0;
      G0_d = 32'h0;
      G1_a = 32'h0;
      G1_b = 32'h0;
      G1_c = 32'h0;
      G1_d = 32'h0;
      G2_a = 32'h0;
      G2_b = 32'h0;
      G2_c = 32'h0;
      G2_d = 32'h0;
      G3_a = 32'h0;
      G3_b = 32'h0;
      G3_c = 32'h0;
      G3_d = 32'h0;

      if (init_v)
        begin
          v_new[0]  = h_reg[0];
          v_new[1]  = h_reg[1];
          v_new[2]  = h_reg[2];
          v_new[3]  = h_reg[3];
          v_new[4]  = h_reg[4];
          v_new[5]  = h_reg[5];
          v_new[6]  = h_reg[6];
          v_new[7]  = h_reg[7];
          v_new[8]  = IV0;
          v_new[9]  = IV1;
          v_new[10] = IV2;
          v_new[11] = IV3;
          v_new[12] = t0_reg ^ IV4;
          v_new[13] = t1_reg ^ IV5;

          if (last_reg) begin
            v_new[14] = ~IV6;
          end else begin
            v_new[14] = IV6;
          end

          v_new[15] = IV7;
          v_we = 1;
        end

      if (update_v)
        begin
          v_we = 1;

          if (G_mode == G_ROW) begin
            // Row updates.
            G0_a      = v_reg[0];
            G0_b      = v_reg[4];
            G0_c      = v_reg[8];
            G0_d      = v_reg[12];
            v_new[0]  = G0_a_prim;
            v_new[4]  = G0_b_prim;
            v_new[8]  = G0_c_prim;
            v_new[12] = G0_d_prim;

            G1_a      = v_reg[1];
            G1_b      = v_reg[5];
            G1_c      = v_reg[9];
            G1_d      = v_reg[13];
            v_new[1]  = G1_a_prim;
            v_new[5]  = G1_b_prim;
            v_new[9]  = G1_c_prim;
            v_new[13] = G1_d_prim;

            G2_a      = v_reg[2];
            G2_b      = v_reg[6];
            G2_c      = v_reg[10];
            G2_d      = v_reg[14];
            v_new[2]  = G2_a_prim;
            v_new[6]  = G2_b_prim;
            v_new[10] = G2_c_prim;
            v_new[14] = G2_d_prim;

            G3_a      = v_reg[3];
            G3_b      = v_reg[7];
            G3_c      = v_reg[11];
            G3_d      = v_reg[15];
            v_new[3]  = G3_a_prim;
            v_new[7]  = G3_b_prim;
            v_new[11] = G3_c_prim;
            v_new[15] = G3_d_prim;
          end
          else begin
            // Diagonal updates.
            G0_a      = v_reg[0];
            G0_b      = v_reg[5];
            G0_c      = v_reg[10];
            G0_d      = v_reg[15];
            v_new[0]  = G0_a_prim;
            v_new[5]  = G0_b_prim;
            v_new[10] = G0_c_prim;
            v_new[15] = G0_d_prim;

            G1_a      = v_reg[1];
            G1_b      = v_reg[6];
            G1_c      = v_reg[11];
            G1_d      = v_reg[12];
            v_new[1]  = G1_a_prim;
            v_new[6]  = G1_b_prim;
            v_new[11] = G1_c_prim;
            v_new[12] = G1_d_prim;

            G2_a      = v_reg[2];
            G2_b      = v_reg[7];
            G2_c      = v_reg[8];
            G2_d      = v_reg[13];
            v_new[2]  = G2_a_prim;
            v_new[7]  = G2_b_prim;
            v_new[8]  = G2_c_prim;
            v_new[13] = G2_d_prim;

            G3_a      = v_reg[3];
            G3_b      = v_reg[4];
            G3_c      = v_reg[9];
            G3_d      = v_reg[14];
            v_new[3]  = G3_a_prim;
            v_new[4]  = G3_b_prim;
            v_new[9]  = G3_c_prim;
            v_new[14] = G3_d_prim;
          end
        end // if (update_v)
    end // compress_logic


  //----------------------------------------------------------------
  // t_ctr
  // Update logic for the length counter t, a monotonically
  // increasing counter with reset.
  //----------------------------------------------------------------
  always @*
    begin : t_ctr
      t0_new = 32'h0;
      t0_we  = 1'h0;
      t1_new = 32'h0;
      t1_we  = 1'h0;

      if (t_ctr_rst) begin
        t0_new = 32'h0;
        t0_we  = 1'h1;
        t1_new = 32'h0;
        t1_we  = 1'h1;
      end

      if (t_ctr_inc) begin
        t0_we = 1'h1;

        if (last_new) begin
          t0_new = t0_reg + {25'h0, blocklen};
        end else begin
          t0_new = t0_reg + {25'h0, BLOCK_BYTES};
        end

        if (t0_new < t0_reg) begin
          t1_new = t1_reg + 1'h1;
          t1_we  = 1'h1;
        end
      end
    end // t_ctr


  //----------------------------------------------------------------
  // round_ctr
  // Update logic for the round counter, a monotonically
  // increasing counter with reset.
  //----------------------------------------------------------------
  always @*
    begin : round_ctr
      round_ctr_new = 4'h0;
      round_ctr_we  = 1'h0;

      if (round_ctr_rst)
        begin
          round_ctr_new = 4'h0;
          round_ctr_we  = 1'h1;
        end

      if (round_ctr_inc)
        begin
          round_ctr_new = round_ctr_reg + 1'b1;
          round_ctr_we  = 1'h1;
        end
    end // round_ctr


  //----------------------------------------------------------------
  // blake2s_ctrl
  //----------------------------------------------------------------
  always @*
    begin : blake2s_ctrl
      init_state         = 1'h0;
      update_state       = 1'h0;
      init_v             = 1'h0;
      update_v           = 1'h0;
      load_m             = 1'h0;
      G_mode             = G_ROW;
      round_ctr_inc      = 1'h0;
      round_ctr_rst      = 1'h0;
      t_ctr_inc          = 1'h0;
      t_ctr_rst          = 1'h0;
      last_new           = 1'h0;
      last_we            = 1'h0;
      ready_new          = 1'h0;
      ready_we           = 1'h0;
      blake2s_ctrl_new   = CTRL_IDLE;
      blake2s_ctrl_we    = 1'h0;


      case (blake2s_ctrl_reg)
        CTRL_IDLE: begin
          if (init) begin
            last_new         = 1'h0;
            last_we          = 1'h1;
            init_state       = 1'h1;
            t_ctr_rst        = 1'h1;
            ready_new        = 1'h0;
            ready_we         = 1'h1;
            blake2s_ctrl_new = CTRL_FINISH;
            blake2s_ctrl_we  = 1'h1;
          end

          if (update) begin
            if (blocklen == BLOCK_BYTES) begin
              load_m           = 1'h1;
              t_ctr_inc        = 1'h1;
              ready_new        = 1'h0;
              ready_we         = 1'h1;
              blake2s_ctrl_new = CTRL_INIT_ROUND;
              blake2s_ctrl_we  = 1'h1;
            end
          end

          if (finish) begin
            load_m           = 1'h1;
            t_ctr_inc        = 1'h1;
            last_new         = 1'h1;
            last_we          = 1'h1;
            ready_new        = 1'h0;
            ready_we         = 1'h1;
            blake2s_ctrl_new = CTRL_INIT_ROUND;
            blake2s_ctrl_we  = 1'h1;
          end
        end


        CTRL_INIT_ROUND: begin
          init_v           = 1'h1;
          round_ctr_rst    = 1'h1;
          blake2s_ctrl_new = CTRL_G_ROW;
          blake2s_ctrl_we  = 1'h1;
        end


        CTRL_G_ROW: begin
          G_mode           = G_ROW;
          update_v         = 1'h1;
          blake2s_ctrl_new = CTRL_G_DIAGONAL;
          blake2s_ctrl_we  = 1'h1;
        end


        CTRL_G_DIAGONAL: begin
          G_mode           = G_DIAGONAL;
          update_v         = 1'h1;
          round_ctr_inc    = 1'h1;
          if (round_ctr_reg == (NUM_ROUNDS - 1)) begin
            blake2s_ctrl_new = CTRL_COMP_DONE;
            blake2s_ctrl_we  = 1'h1;
          end
          else begin
            blake2s_ctrl_new = CTRL_G_ROW;
            blake2s_ctrl_we  = 1'h1;
          end
        end


        CTRL_COMP_DONE: begin
          last_new           = 1'h0;
          last_we            = 1'h1;
          update_state       = 1'h1;
          blake2s_ctrl_new   = CTRL_FINISH;
          blake2s_ctrl_we    = 1'h1;
        end


        CTRL_FINISH: begin
          ready_new        = 1'h1;
          ready_we         = 1'h1;
          blake2s_ctrl_new = CTRL_IDLE;
          blake2s_ctrl_we  = 1'h1;
        end


        default: begin end
      endcase // case (blake2s_ctrl_reg)
    end // blake2s_ctrl
endmodule // blake2s_core

